import { GET_EVENT, UPDATE_EVENT, DELETE_EVENT } from "../constants/reducers";

const initialState = {};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_EVENT:

    case UPDATE_EVENT:
      return state.map()

    case DELETE_EVENT:

    default:
      return state;
  }
}
